import React from "react";
import axios from "axios";

const World =  async () => {
    const rec = await axios({
        "method":"GET",
        "url":"https://corona.lmao.ninja/countries",
        "params":{
        "sort":"cases"
        }
        })
    .then((response)=>{
        const Timeline = response.data;
        return Timeline;
    })
    .catch((error)=>{
        console.log(error)
});
return await rec;
}

const run = async () => {
    const wrl = await World();
    return await wrl;

}

export default run;
